import React from 'react';
import { withCookies } from 'react-cookie';
import './EditingPanel.style.scss';
import { CloseCircleFilled } from '@ant-design/icons';
import PageBase from '../../../../../utilities/PageBase/PageBase';

class EditingPanel extends PageBase {
  constructor(props) {
    super(props);
    this.state = {
      isVisible: false
    }
  }

  setVisible(isVisible) {
    this.setState({ isVisible });
  }

  render() {
    return (
      this.state.isVisible ? (
        <div className="product-management__supplier-dialog__editing-panel">
          <div className="product-management__supplier-dialog__editing-panel__panel animated slideInRight">
            <div className="product-management__supplier-dialog__editing-panel__panel__header">
              <CloseCircleFilled
                className="product-management__supplier-dialog__editing-panel__panel__header__btn-close"
                onClick={() => this.setVisible(false)}
              />
            </div>
          </div>
        </div>
      ) : <></>
    )
  }
}
export default withCookies(EditingPanel);
